import React from "react";
import "./css/index.css";
import App from "./App";
import { createStore, combineReducers, applyMiddleware } from "redux";
import reservationApp from "./reservation/reducers";
import { Provider } from "react-redux";
import { render } from "react-dom";
import dateStepReducer from "./date-step/reducers";
import itemStepReducer from "./item-selection-step/reducers";
import loaderReducer from "./loader/reducers";
import extrasStepReducer from './extras-step/reducers';
import summaryReducer from './modules/summary/reducers';
import thunkMiddleware from "redux-thunk";
import Root from "./views/root";

const store = createStore(
  combineReducers({
    reservationApp,
    dateStepReducer,
    itemStepReducer,
    extrasStepReducer,
    loaderReducer, 
    summaryReducer
  }),
  applyMiddleware(thunkMiddleware)
);

render(<Root store={store} />, document.getElementById("root"));
